    TxText: "Wie froh bin ich,   da ich weg bin! Bester Freund,   was ist das Herz des Menschen! Dich zu verlassen,   den ich so liebe,   von dem ich unzertrennlich war,   und froh zu sein! Ich wei,   du verzeihst mir's. Waren nicht meine brigen Verbindungen recht ausgesucht vom Schicksal,   um ein Herz wie das meine zu ngstigen? Die arme Leonore! Und doch war ich unschuldig. Konnt' ich dafr,   da,   whrend die eigensinnigen Reize ihrer Schwester mir eine angenehme Unterhaltung verschafften,   da eine Leidenschaft in dem armen Herzen sich bildete? Und doch  bin ich ganz unschuldig? Hab' ich nicht ihre Empfindungen genhrt? Hab' ich mich nicht an den ganz wahren Ausdrcken der Natur,   die uns so oft zu lachen machten,   so wenig lcherlich sie waren,   selbst ergetzt? Hab' ich nicht  o was ist der Mensch,   da er ber sich klagen darf! Ich will,   lieber Freund,   ich verspreche dir's,   ich will mich bessern,   will nicht mehr ein bichen bel,   das uns das Schicksal vorlegt,   wiederkuen,   wie ich's immer getan habe; ich will das Gegenwrtige genieen,   und das Vergangene soll mir vergangen sein. Gewi,   du hast recht,   Bester,   der Schmerzen wren minder unter den Menschen,   wenn sie nicht  Gott wei,   warum sie so gemacht sind!  mit so viel Emsigkeit der Einbildungskraft sich beschftigten,   die Erinnerungen des vergangenen bels zurckzurufen,   eher als eine gleichgltige Gegenwart zu ertragen.\nDu bist so gut,   meiner Mutter zu sagen,   da ich ihr Geschft bestens betreiben und ihr ehstens Nachricht davon geben werde. Ich habe meine Tante gesprochen und bei weitem das bse Weib nicht gefunden,   das man bei uns aus ihr macht. Sie ist eine muntere,   heftige Frau von dem besten Herzen. Ich erklrte ihr meiner Mutter Beschwerden ber den zurckgehaltenen Erbschaftsanteil; sie sagte mir ihre Grnde,   Ursachen und die Bedingungen,   unter welchen sie bereit wre,   alles herauszugeben,   und mehr als wir verlangten  kurz,   ich mag jetzt nichts davon schreiben,   sage meiner Mutter,   es werde alles gut gehen. Und ich habe,   mein Lieber,   wieder bei diesem kleinen Geschft gefunden,   da Miverstndnisse und Trgheit vielleicht mehr Irrungen in der Welt machen als List und Bosheit. Wenigstens sind die beiden letzteren gewi seltener.\nbrigens befinde ich mich hier gar wohl. Die Einsamkeit ist meinem Herzen kstlicher Balsam in dieser paradiesischen Gegend,   und diese Jahreszeit der Jugend wrmt mit aller Flle mein oft schauderndes Herz. Jeder Baum,   jede Hecke ist ein Strau von Blten,   und man mchte zum Maienkfer werden,   um in dem Meer von Wohlgerchen herumschweben und alle seine Nahrung darin finden zu knnen.\nDie Stadt selbst ist unangenehm,   dagegen rings umher eine unaussprechliche Schnheit der Natur. Das bewog den verstorbenen Grafen von M.,   einen Garten auf einem der Hgel anzulegen,   die mit der schnsten Mannigfaltigkeit sich kreuzen und die lieblichsten Tler bilden. Der Garten ist einfach,   und man fhlt gleich bei dem Eintritte,   da nicht ein wissenschaftlicher Grtner,   sondern ein fhlendes Herz den Plan gezeichnet,   das seiner selbst hier genieen wollte. Schon manche Trne hab' ich dem Abgeschiedenen in dem verfallenen Kabinettchen geweint,   das sein Lieblingspltzchen war und auch meines ist. Bald werde ich Herr vom Garten sein; der Grtner ist mir zugetan,   nur seit den paar Tagen,   und er wird sich nicht bel dabei befinden.",
